import React, { Fragment } from 'react';
import {Link} from 'react-router-dom';

const Home = () => (
    <Fragment>
        <Link className="arounding" to="/">Home</Link>
        <h1>Holla from React</h1>
        <p>Heya friends</p>
    </Fragment>
);

export default Home;
